function [lambda, l] =  solver_rect_cos_4_bs(x,s,c)
% x contains the four points which are in correspondence
% so x(:,1) <-> x(:,2) <-> x(:,3) <-> x(:,4)
% size(x) = [2 4]

if size(x,1) == 3
    x = x(1:2,:);
end

% Rescale the scale
s = s ./ mean(abs(s));

data = [x];
d = sum(data(1:2,:).^2);

% Rescale line and lambda unknowns
scale_line = mean(abs(data(1:2,:)),2);
scale_lambda = mean(d);

data(1:2,:) = diag(1./scale_line)*data(1:2,:);
data = [data; s; c; d / scale_lambda];

sols = solve(data);

sols = real(sols(:,max(abs(imag(sols)))<1e-6));

% Revert rescaling
lambda = sols(1,:) / scale_lambda;
l = diag(1./scale_line) * sols(2:3,:);

